Description du produit
Le récepteur dongle Xbox one est associé à la poignée Xbox one  2.4G en se connectant à la console ou à l’ordinateur XONE . Le récepteur dongle Xbox one prend en charge toutes les séries de consoles XBOX ONE et les systèmes d’exploitation PC WINDOWS 10 et supérieurs, et prend en charge l’énorme plate-forme de jeu Steam . ;
2. Description des fonctions
1) prend en charge le câble de données TYPE-C ;
2) Les nouvelles touches de direction hybrides peuvent saisir avec précision les instructions de fonctionnement et créer une véritable expérience de jeu.
3) Un retour exquis du moteur de vibration peut rendre les armes, les impacts et les vibrations réalistes.
4) joystick polyvalent, contrôle total à 360 °, rebond rapide et précision supérieure
5) Peut être mis à niveau via USB
3. Opération de poignée
  Mode hôte :
Le récepteur du dongle Xbox One est inséré dans la console et le voyant LED clignote lentement (1S). À ce moment, appuyez brièvement sur le bouton d’appairage et le voyant LED clignote rapidement (250 ms) pour entrer dans l’état d’appairage lorsque la Xbox One .  Le contrôleur 2.4G est en mode veille, appuyez brièvement sur le bouton du contrôleur, le voyant LED clignote lentement (1S), puis appuyez brièvement sur le bouton HOME, le voyant LED clignote rapidement (250 ms) et entre dans l’état d’appairage. le récepteur et la poignée sont connectés avec succès, les indicateurs LED du récepteur et de la poignée sont toujours allumés ;
Une fois que le récepteur et le contrôleur sont connectés avec succès : 1. Appuyez et maintenez le bouton HOME du contrôleur pendant 5 secondes. Le contrôleur peut être arrêté directement. La LED du récepteur clignotera lentement et entrera en mode de reconnexion. le contrôleur sera arrêté.
Mode Windows ( XBOX ) : 
         Le récepteur du dongle Xbox One est branché sur l’ordinateur, le voyant LED clignote lentement (1S), puis appuyez brièvement sur le bouton d’appairage, le voyant LED clignote rapidement (250 ms), entrant dans l’état d’appairage lorsque le contrôleur Xbox One  2.4G est en marche ; mode veille, appuyez brièvement sur HOME sur le bouton du contrôleur, le voyant LED clignote lentement (1S), puis appuyez brièvement sur le bouton PS, le voyant LED clignote rapidement (250 ms) et entre dans l’état d’appairage lorsque le récepteur et la poignée sont connectés avec succès. , la LED bleue du récepteur et la LED blanche de la poignée sont toutes toujours allumées ;
Une fois que le récepteur et le contrôleur sont connectés avec succès : 1. Appuyez et maintenez le bouton HOME du contrôleur pendant 5 secondes. Le contrôleur peut être arrêté directement. La LED du récepteur clignotera lentement et entrera en mode de reconnexion. le contrôleur sera arrêté.
Mode de reconnexion :
           Une fois le récepteur dongle Xbox One et le contrôleur Xbox One  2.4G connectés avec succès, la prochaine fois, une fois le contrôleur et le récepteur allumés, ils pourront être connectés directement sans appuyer sur le bouton d’appairage ;
Branchez le récepteur sur l’hôte ou l’ordinateur, le lumière LED clignotera lentement (1S) et entrera en mode de reconnexion ;
Lorsque la poignée est en mode veille, appuyez brièvement sur le bouton HOME de la poignée et le lumière LED clignotera lentement (1S) pour passer en mode de reconnexion ;

